import { Link } from "react-router-dom";
import "./Links.css";

function Links() {
  return (
    <div className="linksContainer">
      <div className="links">
        <Link to="/" className="link">
          Цитатки
        </Link>
        <Link to="/createQuote" className="link">
          Создать цитатку
        </Link>
      </div>
    </div>
  );
}

export default Links;
